import { useDrag } from "react-dnd";

const PictureList = ({title, id}) => {

    const [{ isDragging }, drag] = useDrag(() => ({
        type: "image",
        
        collect: (monitor) => ({
            isDragging: !!monitor.isDragging(),
        }),
    }))

    return <div 
        className='item'
        ref={drag}>
        {title}
    </div>
}

export default PictureList;
